import { React } from "react";
import BoardRow from "./BoardRow";
import styled from "styled-components";
import socket from "../connection/socket";

const StyledBoard = styled.div``;

socket();

const Board = () => {
  return (
    <StyledBoard>
      <BoardRow rowId={0} />
      <BoardRow rowId={1} />
      <BoardRow rowId={2} />
    </StyledBoard>
  );
};

export default Board;
